import React from "react";
import Header from "../../Components/Header";
import Card from "../../Components/UI/Cards";
import "./style.css";

const Home = (props) => {
  return (
    <div>
      <Card>
        <div className="gallerypost">
          <section>
            <div>
              <img src={"../../blogimg/md.jpg"} alt="" />
            </div>
          </section>
          <section>Less Popular</section>
        </div>
      </Card>
    </div>
  );
};

export default Home;
